					if((not 'nenes_basement_unlocked' in level.player.vars.triggered_events),
					[
					speech_dialog(self,
								self, [~Oh, well maybe before you go~, ~you could look at my basement.~],
	              				set(level.player.animation, 'emote_confused'),
								level.player, ['Your basement?'],
								
								
								if((not find(level.chars, 'c', c.type in ['key_golden'])) and (not level.player.vars.swallowed.type = 'key_golden'),spawn('key_golden',800,150,1)),
								
								
								self, [~Yes, here's the key~, ~There're some ants down there.~],
								[~They're freaking me out.~],
	              				set(level.player.animation, 'emote_raisedfinger'),
								level.player, ['Sure thing. I need a job!',
											   'How much were you figuring on',
											   'paying for a pest exterminator?'],
								self, [~Well sheesh, I thought you'd~,
									   ~do it for free for a friend!~],
									   [~But if you're going to be like that~,
									    ~I think I left a health capsule down there.~,
								       ~If you can clear it out, it's yours.~]) ])],
								       
					speech_dialog(self, [~So, did you end up taking care~,~of those ants down there?~],
	              				set(level.player.animation, 'emote_nod'),
									level.player, [~Of course.~,~I don't disappoint!~],
	              				set(level.player.animation, 'emote_raisedfinger'),
												[~And thanks for the gift,~,~by the way.~],
										self,	[~You're welcome.~])
					
								       
								       )]"
